function concept(props){
    return(

        <ul id="concepts">
        {props.concepts.map(item => (
             <li className="concept">
                        <img key={item.id} src={item.image} alt="TODO: TITLE" />
                        <h2 key={item.id}>{item.title}</h2>
                        <p key={item.id}>{item.description}</p>
            </li>
        ))}
</ul>

    );
}
export default Concept;
